import React from 'react';
import { Slider, Tabs } from '../../blocks';
import { Popup } from '../../layout';
import { Wrapper } from './styles';

const MainPage: React.FC = () => {
  return (
    <main>
      <Wrapper>
        <Slider />
        <Tabs />
        <Popup />
      </Wrapper>
    </main>
  )
};

export default MainPage;
